import styles from './Navbar.module.scss';

const Nav = () => {
  return (
    <div>
      <div className="container">
        <div className={"row"}>
          <ul>
            <li>Logo</li>
            <li>Search</li>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default Nav;
